<template>
	<view class="animated fadeIn faster">
		<loadings v-if="beforeReady"></loadings>
		<tui-tips position="center" ref="toast"></tui-tips>
		<tui-modal :show="modal" @click="handleClick" @cancel="hide" content="确定退出登录吗？" color="#333" :size="32" :button="button"></tui-modal>
		<view class="top-container">
			<view class="logouts" @click="logouts()">
				<text style="font-size: 14px;margin-right: 20rpx;vertical-align: middle;line-height: 100rpx;">退出</text>
				<image src="../../static/images/mycard04.png" style="width: 36rpx;height: 36rpx;vertical-align: middle;"></image>
			</view>
		</view>
		<view class="boxs-top">
			<image :src="getheadPic()" class="top-head" @click="imageTap()"></image>
			<view class="boxstop-text">
				<view>
					{{ userinfo.baseCount }}
					<text style="color:rgba(170,178,183,1);">\n管理基地</text>
				</view>
				<view style="line-height: 130rpx;">{{ userinfo.realName }}</view>
				<view>
					{{ userinfo.lotCount }}
					<text style="color:rgba(170,178,183,1);">\n管理地块</text>
				</view>
			</view>
		</view>
		<view class="boxs-bottom">
			<tui-list-cell :arrow="true" class="tui-list" @click="goversion()">
				<image src="../../static/images/mycard01.png" style="width: 36rpx;height: 36rpx;"></image>
				<text class="tui-list-cell-name">更新日志</text>
			</tui-list-cell>
			<tui-list-cell :arrow="true" class="tui-list" @click="goperson()">
				<image src="../../static/images/mycard03.png" style="width: 36rpx;height: 36rpx;"></image>
				<text class="tui-list-cell-name">个人资料</text>
			</tui-list-cell>
			<tui-list-cell :arrow="true" class="tui-list" @click="gochangepass()">
				<image src="../../static/images/mycard02.png" style="width: 36rpx;height: 36rpx;"></image>
				<text class="tui-list-cell-name">修改密码</text>
			</tui-list-cell>
		</view>
		<!-- <button type="warn" @click="logouts">退出登录</button> -->
	</view>
</template>

<script>
import loading from '@/common/loadings/loading.js';
import tuiTips from '@/components/messtips/messtips.vue';
import tuiListCell from '@/components/thorlUI/list-cell/list-cell.vue';
import tuiModal from '@/components/thorlUI/modal/modal.vue';
export default {
	mixins: [loading],
	components: {
		tuiTips,
		tuiListCell,
		tuiModal
	},
	data() {
		return {
			userinfo: {},
			pictureUrlList: [],
			isfirstheadpic: false,
			urlpic: null,
			modal: false,
			button: [
				{
					text: '取消',
					type: 'gray'
				},
				{
					text: '确定',
					type: 'red'
				}
			]
		};
	},
	onLoad() {
		this.$http.get(this.$appurl.getUserInfo).then(res => {
			if (res.success) {
				this.userinfo = res.result;
			}
		});
	},
	methods: {
		logouts() {
			this.modal = true;
		},
		getheadPic() {
			if (this.userinfo.headPic != '' && this.userinfo.headPic != null) {
				var url = this.$http.common.baseUrl + this.$appurl.pictures + this.userinfo.headPic.pictureUrl;
				this.urlpic = url;
				return url;
			}
		},
		imageTap() {
			this.pictureUrlList = [this.urlpic];
			uni.previewImage({
				urls: this.pictureUrlList,
				loop: 'true',
				indicator: 'default'
			});
		},
		gochangepass() {
			uni.navigateTo({
				url: 'changepass'
			});
		},
		goperson(){
			var data = JSON.stringify(this.userinfo);
			uni.navigateTo({
				url: 'personalCen?data=' + data
			});
		},
		goversion(){
			uni.navigateTo({
				url: 'version'
			});
		},
		handleClick(e) {
			let index = e.index;
			let that = this;
			if (index == 1) {
				that.hide();
				this.$http.get(this.$appurl.logout).then(res => {
					if (res.success) {
						var isupdaapp = {};
						try {
							const value = uni.getStorageSync('noupdowns');
							if (value) {
								isupdaapp = value;
							}
						} catch (e) {
							// error
						}
						try {
							uni.clearStorageSync();
						} catch (e) {
							// error
						}
						try {
							uni.setStorageSync('noupdowns', isupdaapp);
						} catch (e) {
							// error
						}
						let options = {
							msg: res.message,
							duration: 2000,
							type: "green"
						};
						that.$refs.toast.showTips(options);
						setTimeout(function() {
							uni.reLaunch({
								url: '../login/login'
							});
						}, 1000);
					}
				});
			} else {
				this.hide();
			}
		},
		hide() {
			this.modal = false;
		}
	}
};
</script>

